INSERT INTO `template_config` VALUES ('12', 'bui_Mybatis', 'mapper', 'xml', '${context.javaBeanNameLF}Mapper.xml', '#set($jq=\"$\")\r\n<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\r\n<!DOCTYPE  mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\" >\r\n<!--      \r\n	This file is automatically generated by autoCode(https://git.oschina.net/durcframework/autoCode)\r\n-->\r\n<mapper namespace=\"${context.packageName}.dao.${context.javaBeanName}Dao\">\r\n    <resultMap id=\"queryResultMap\" type=\"${context.packageName}.entity.${context.javaBeanName}\">\r\n        #foreach($column in $columns)\r\n        #if( \"${column.comment}\" != \"\" )\r\n		<!-- ${column.comment} -->\r\n		#end\r\n        <result column=\"${column.columnName}\" property=\"${column.javaFieldName}\" jdbcType=\"${column.mybatisJdbcType}\" />\r\n        #end\r\n    </resultMap>\r\n    \r\n    <!-- 聚合查询 -->\r\n    <select id=\"findProjection\" parameterType=\"org.durcframework.core.expression.projection.ProjectionQuery\" resultType=\"java.util.HashMap\">\r\n		SELECT\r\n			<include refid=\"expressionBlock.projectionColumn\"/>\r\n		FROM ${table.tableName} t\r\n		<include refid=\"expressionBlock.where\"/>  \r\n		<include refid=\"expressionBlock.groupBy\"/>\r\n		<include refid=\"expressionBlock.having\"/>\r\n		<if test=\"order != null\">\r\n			ORDER BY ${jq}{order}\r\n		</if>\r\n	</select>\r\n	\r\n	<!-- 根据条件查询记录 -->\r\n    <select id=\"find\" parameterType=\"org.durcframework.core.expression.ExpressionQuery\"\r\n		resultMap=\"queryResultMap\">\r\n		SELECT \r\n        <choose>\r\n            <when test=\"columns.size>0\">\r\n            <foreach collection=\"columns\" item=\"column\" separator=\",\" >\r\n            	${jq}{column}\r\n            </foreach>\r\n            </when>\r\n            <otherwise>\r\n            #set ($i=0) \r\n            #foreach($column in $columns)                         \r\n            	#if($i > 0),#end t.${column.columnName}\r\n    			#set($i=$i +1)             \r\n            #end\r\n            </otherwise>\r\n		</choose>\r\n        \r\n		FROM ${table.tableName} t\r\n		<include refid=\"expressionBlock.where\" />\r\n		<choose>\r\n			<when test=\"order == null\">\r\n				ORDER BY t.${context.pkName} desc\r\n			</when>\r\n			<otherwise>\r\n				ORDER BY ${jq}{order}\r\n			</otherwise>\r\n		</choose>\r\n		<if test=\"!isQueryAll\">\r\n			LIMIT\r\n			#{start,jdbcType=INTEGER},#{limit,jdbcType=INTEGER}\r\n		</if>\r\n	</select>\r\n\r\n	<!-- 根据条件查询记录数 -->\r\n    <select id=\"findTotalCount\" parameterType=\"org.durcframework.core.expression.ExpressionQuery\"\r\n		resultType=\"java.lang.Integer\">\r\n		SELECT count(*) FROM ${table.tableName} t\r\n		<include refid=\"expressionBlock.where\" />\r\n    </select>\r\n\r\n	<!-- 保存,保存全部字段 -->\r\n    <insert id=\"save\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\"\r\n#if(${pkColumn.isIdentity})\r\n    keyProperty=\"${context.javaPkName}\" keyColumn=\"${context.pkName}\" useGeneratedKeys=\"true\"\r\n#end\r\n    >\r\n	INSERT INTO ${table.tableName}\r\n         (\r\n #set ($i=0) \r\n        #foreach($column in $columns) \r\n            #if(!${column.isIdentityPk})               \r\n        #if($i > 0),#end `${column.columnName}`\r\n#set($i=$i +1)\r\n            #end          \r\n        #end\r\n          )\r\n	VALUES (\r\n #set ($i=0) \r\n        #foreach($column in $columns) \r\n            #if(!${column.isIdentityPk})               \r\n        #if($i > 0),#end #{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}}\r\n#set($i=$i +1)\r\n            #end          \r\n        #end\r\n \r\n        )\r\n	</insert>\r\n    \r\n    <!-- 保存,保存不为NULL的字段 -->\r\n    <insert id=\"saveNotNull\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\"\r\n    #if(${pkColumn.isIdentity})\r\n        keyProperty=\"${context.javaPkName}\" keyColumn=\"${context.pkName}\" useGeneratedKeys=\"true\"\r\n    #end\r\n        >\r\n        INSERT INTO ${table.tableName}\r\n    \r\n        <trim prefix=\"(\" suffix=\")\" suffixOverrides=\",\">	 \r\n\r\n            #foreach($column in $columns) \r\n                #if(!${column.isIdentityPk}) \r\n                    <if test=\"${column.javaFieldName} != null\">\r\n                   `${column.columnName}`,\r\n                    </if>\r\n                #end          \r\n            #end\r\n        </trim>\r\n        <trim prefix=\"values (\" suffix=\")\" suffixOverrides=\",\">            \r\n            #foreach($column in $columns) \r\n                #if(!${column.isIdentityPk})  \r\n                    <if test=\"${column.javaFieldName} != null\" >\r\n                    #{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}},                    \r\n                    </if>\r\n                #end          \r\n            #end\r\n        </trim>\r\n    </insert>\r\n\r\n	<!-- 更新,更新全部字段 -->\r\n    <update id=\"update\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\">\r\n    UPDATE ${table.tableName}\r\n     <set>		\r\n     #foreach($column in $columns) \r\n         #if(!${column.isPk})               \r\n         ${column.columnName}=#{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}},        \r\n         #end          \r\n     #end\r\n     </set>	\r\n    WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\r\n    </update>\r\n    \r\n    <!-- 根据指定条件更新 -->\r\n    <update id=\"updateByExpression\">\r\n		UPDATE ${table.tableName}\r\n        <set>		\r\n        #foreach($column in $columns) \r\n            #if(!${column.isPk})               \r\n        	${column.columnName}=#{entity.${column.javaFieldName},jdbcType=${column.mybatisJdbcType}},        \r\n     		#end          \r\n        #end\r\n        </set>\r\n		<include refid=\"expressionBlock.updateWhere\" />\r\n	</update>\r\n    \r\n    <!-- 更新不为NULL的字段 -->\r\n    <update id=\"updateNotNull\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\">\r\n    UPDATE ${table.tableName}\r\n    <set>\r\n    	#foreach($column in $columns) \r\n            #if(!${column.isPk})  \r\n                <if test=\"${column.javaFieldName} != null\" >\r\n                ${column.columnName}=#{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}},                 \r\n                </if>\r\n            #end          \r\n        #end\r\n    </set>\r\n    WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\r\n    </update>\r\n    \r\n    <!-- 根据指定条件更新不为NULL的字段 -->\r\n    <update id=\"updateNotNullByExpression\">\r\n    UPDATE ${table.tableName}\r\n    <set>\r\n    	#foreach($column in $columns) \r\n            #if(!${column.isPk})  \r\n                <if test=\"entity.${column.javaFieldName} != null\" >\r\n                ${column.columnName}=#{entity.${column.javaFieldName},jdbcType=${column.mybatisJdbcType}},                 \r\n                </if>\r\n            #end          \r\n        #end\r\n    </set>\r\n    <include refid=\"expressionBlock.updateWhere\" />\r\n    </update>\r\n\r\n	<!-- 根据主键获取单条记录 -->\r\n    <select id=\"get\" resultMap=\"queryResultMap\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\">\r\n		SELECT \r\n        #set ($i=0) \r\n        #foreach($column in $columns)                         \r\n        #if($i > 0),#end t.${column.columnName}\r\n#set($i=$i +1)             \r\n        #end\r\n		FROM ${table.tableName} t\r\n		WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\r\n	</select>\r\n    \r\n    <!-- 根据条件获取单条记录 -->\r\n    <select id=\"getByExpression\" resultMap=\"queryResultMap\" parameterType=\"org.durcframework.core.expression.ExpressionQuery\">\r\n		SELECT\r\n		#set ($i=0) \r\n        #foreach($column in $columns)                         \r\n        	#if($i > 0),#end t.${column.columnName}\r\n			#set($i=$i +1)             \r\n        #end\r\n		FROM ${table.tableName} t\r\n		<include refid=\"expressionBlock.where\" />\r\n	</select>\r\n	\r\n	<!-- 根据主键删除记录 -->\r\n	<delete id=\"del\" parameterType=\"${context.packageName}.entity.${context.javaBeanName}\">\r\n		DELETE FROM ${table.tableName}\r\n		WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\r\n	</delete>    \r\n    \r\n    <!-- 根据条件删除记录 -->\r\n    <delete id=\"delByExpression\" parameterType=\"org.durcframework.core.expression.ExpressionQuery\">\r\n		DELETE FROM ${table.tableName}\r\n		<include refid=\"expressionBlock.where\" />\r\n	</delete>\r\n\r\n</mapper>', 'admin');
INSERT INTO `template_config` VALUES ('14', 'bui_Controller', 'controller', 'java', '${context.javaBeanName}Controller.java', 'package ${context.packageName}.controller;\n\nimport org.durcframework.core.GridResult;\nimport org.durcframework.core.MessageResult;\nimport org.durcframework.core.controller.CrudController;\nimport ${context.packageName}.entity.${context.javaBeanName};\nimport ${context.packageName}.entity.${context.javaBeanName}Sch;\nimport ${context.packageName}.service.${context.javaBeanName}Service;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.ResponseBody;\n\n@Controller\npublic class ${context.javaBeanName}Controller extends\n		CrudController<${context.javaBeanName}, ${context.javaBeanName}Service> {\n\n	@RequestMapping(\"/add${context.javaBeanName}.do\")\n	public ModelAndView add${context.javaBeanName}(${context.javaBeanName} entity) {\n		return this.add(entity);\n	}\n\n	@RequestMapping(\"/list${context.javaBeanName}.do\")\n	public ModelAndView list${context.javaBeanName}(${context.javaBeanName}Sch searchEntity) {\n		return this.list(searchEntity);\n	}\n\n	@RequestMapping(\"/update${context.javaBeanName}.do\")\n	public ModelAndView update${context.javaBeanName}(${context.javaBeanName} entity) {\n		return this.modify(entity);\n	}\n\n	@RequestMapping(\"/del${context.javaBeanName}.do\")\n	public ModelAndView del${context.javaBeanName}(${context.javaBeanName} entity) {\n		return this.remove(entity);\n	}\n	\n}', 'admin');
INSERT INTO `template_config` VALUES ('15', 'sw-mybatis-sqlserver', '${context.javaBeanNameLF}/mapper', 'xml', '${context.javaBeanNameLF}Mapper.xml', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\" >\n<mapper namespace=\"${context.packageName}.${context.javaBeanNameLF}.dao.${context.javaBeanName}Dao\">\n<resultMap id=\"BaseResultMap\" type=\"${context.packageName}.${context.javaBeanNameLF}.pojo.${context.javaBeanName}\">\n#foreach($column in $columns)\n    <result column=\"${column.columnName}\" property=\"${column.javaFieldName}\" jdbcType=\"${column.mybatisJdbcType}\"/>\n#end	\n</resultMap>\n	<select id=\"query\" resultMap=\"BaseResultMap\" parameterType=\"com.shunwang.business.framework.mybatis.query.ConditionQuery\" >\n		<if test=\"paramMap.rp>0\">\n			SELECT t0.* FROM (\n		</if>\n		select row_number() over(order by\n		<choose>\n			<when test=\"paramMap.orderCol!=null\">\n				${paramMap.orderCol}\n			</when>\n			<otherwise>\n				${context.pkName} desc\n			</otherwise>\n		</choose>\n		) row\n                \n        #foreach($column in $columns)                          \n               ,${column.columnName}                                  \n        #end\n		from ${table.tableName} t \n		<include refid=\"conditionQuery.core\" />\n 		<if test=\"paramMap.rp > 0\">\n			) t0 WHERE t0.row BETWEEN (#{paramMap.firstResult} +1) AND\n			(#{paramMap.firstResult}  + #{paramMap.rp})\n		</if>\n	</select>\n	<select id=\"get\" resultMap=\"BaseResultMap\" parameterType=\"java.lang.Integer\" >\n   SELECT \n#set ($i=0) \n        #foreach($column in $columns)                          \n                #if($i > 0),#end \n                ${column.columnName}\n                  #set($i=$i +1)                  \n        #end\n        FROM ${table.tableName}\n        WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\n	 </select>\n	<delete id=\"delete\" parameterType=\"${context.packageName}.${context.javaBeanNameLF}.pojo.${context.javaBeanName}\" >\n       DELETE FROM ${table.tableName}\n        WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\n	</delete>\n	<insert id=\"save\" parameterType=\"${context.packageName}.${context.javaBeanNameLF}.pojo.${context.javaBeanName}\" useGeneratedKeys=\"true\" keyProperty=\"${context.javaPkName}\">\n		INSERT INTO ${table.tableName}\n         (\n #set ($i=0) \n        #foreach($column in $columns) \n            #if(!${column.isIdentityPk})               \n        #if($i > 0),#end ${column.columnName}\n               #set($i=$i +1)\n            #end          \n        #end\n          )\n    VALUES (\n        #set ($i=0) \n        #foreach($column in $columns) \n            #if(!${column.isIdentityPk})               \n        #if($i > 0),#end #{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}}\n               #set($i=$i +1)\n            #end          \n        #end\n \n        )\n	</insert>\n	<select id=\"queryCnt\" parameterType=\"com.shunwang.business.framework.mybatis.query.ConditionQuery\" resultType=\"java.lang.Integer\" >\n		select count(*) from ${table.tableName} t\n		<include refid=\"conditionQuery.core\" />\n	</select>\n\n    <update id=\"update\" parameterType=\"${context.packageName}.${context.javaBeanNameLF}.pojo.${context.javaBeanName}\">\n    UPDATE ${table.tableName}\n    SET \n#set ($i=0) \n        #foreach($column in $columns) \n            #if(!${column.isPk})               \n        #if($i > 0),#end ${column.columnName}=#{${column.javaFieldName},jdbcType=${column.mybatisJdbcType}}\n               #set($i=$i +1)\n            #end          \n        #end    \n    WHERE ${context.pkName} = #{${context.javaPkName},jdbcType=${context.mybatisPkType}}\n    </update>\n</mapper>', 'admin');
INSERT INTO `template_config` VALUES ('16', 'sw-pojo', '${context.javaBeanNameLF}/pojo', 'java', '${context.javaBeanName}.java', 'package ${context.packageName}.${context.javaBeanNameLF}.pojo;\n\nimport com.shunwang.business.framework.pojo.BasePojo;\n\npublic class ${context.javaBeanName} extends BasePojo {\n#foreach($column in $columns) \n    private ${column.javaTypeBox} ${column.javaFieldName};\n#end\n\n#foreach(${column} in ${columns}) \n    public void set${column.javaFieldNameUF}(${column.javaTypeBox} ${column.javaFieldName}){\n        this.${column.javaFieldName} = ${column.javaFieldName};\n    }\n\n    public ${column.javaTypeBox} get${column.javaFieldNameUF}(){\n        return this.${column.javaFieldName};\n    }\n\n#end\n}', 'admin');
